const App = () => {
    const [num , setnum] = useState(null);

    const Api = async() => {
        const url = `https://api.tvmaze.com/search/shows?q=all`;
        const res = await fetch(url);
        const ress = await res.json();
        console.log(ress[1].show.name);
        setnum(ress[1].show);
    }   

    Api();
    // console.log(num);
  
    return (
        <><h1>  {num.name}</h1>
        <img src={num.image.medium} />

  

        </>

    )
};

export default App;
